import logo from './logo.svg';
import './App.css';
import Hauptseite from './pages/Hauptseite';
import Header from './components/header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Hauptseite/>
        <Header/>
      </header>
    </div>
  );
}

export default App;
